    false,nt"url": null,nt"notes": "Digital surfaces and thicknesses of selected
    hydrogeologic units of the Floridan aquifer system were developed to define an updated
    hydrogeologic framework as part of the U.S. Geological Survey Groundwater Resources
    Program. This feature class contains the polygon region of the weathered limestone
    residuum overlying the FAS. It was developed on the basis of lithologic descriptions
    and from geologic maps showing the limestone outcrop areas. Residuum may not be
    present across the entire area of the polygon, especially in stream valleys where
